import React from "react";
import {
  whyWrapper,
  whyContainer,
  whyRow,
  Column1,
  Column2,
  TextWrapper,
  TopLine,
  Heading,
  Sub,
  BtnWrap,
  Img,
  ImgWrap,
} from "./whyElements";
import { Button } from "../ButtonElemnt";

const whySection = ({
  id,
  imgstart,
  topLine,
  lightText,
  darkText,
  headline,
  description,
  alt,
  img,
  lightBg,
  buttonLable,
  primary,
  dark,
  //dark2,
}) => {
  return (
    <>
      <whyContainer lightBg={lightBg} id={id}>
        <whyWrapper>
          <whyRow imgstart={imgstart}>
            <Column1>
              <TextWrapper>
                <TopLine>{topLine}</TopLine>
                <Heading lightText={lightText}>{headline}</Heading>
                <Sub darkText={darkText}>{description}</Sub>
                <BtnWrap>
                  <Button
                    to="home"
                    primary={primary ? 1 : 0}
                    smooth={true}
                    duration={500}
                    spy={true}
                    exact={true}
                    offset={-80}
                    dark={dark ? 1 : 0}
                  >
                    {buttonLable}
                  </Button>
                </BtnWrap>
              </TextWrapper>
            </Column1>
            <Column2>
              <ImgWrap>
                <Img src={img} alt={alt} />
              </ImgWrap>
            </Column2>
          </whyRow>
        </whyWrapper>
      </whyContainer>
    </>
  );
};

export default whySection;
